package leetcode.OOD;

/*
 * https://leetcode.com/problems/design-twitter
 */

import java.util.*;

class Tweet {
	int id;
	int timestamp;

	public Tweet(int id, int timestamp) {
		this.id = id;
		this.timestamp = timestamp;
	}
}
class User {
	int id;
	List<Tweet> tweets;
	Set<Integer> followees;

	public User(int id) {
		this.id = id;
		tweets = new LinkedList<>();
		followees = new HashSet<>();
	}

	@Override
	public int hashCode() {
		return this.id;
	}
	@Override
	public boolean equals(Object o) {
		if (this == o) return true;
		if (o == null || getClass() != o.getClass()) return false;
		User user = (User) o;
		return id == user.id;
	}
}
class Twitter {
	final static int NEWS_FEED_SIZE = 10;
	Map<Integer, User> users;   // stores all registered users
	static int timestamp;

	public Twitter() {
		users = new HashMap<>();
		timestamp = 0;
	}
	
	public void postTweet(int userId, int tweetId) {
		User user = users.getOrDefault(userId, new User(userId));

		List<Tweet> tweetsByUser = user.tweets;
		if (tweetsByUser == null)
			tweetsByUser = new LinkedList<>();
		tweetsByUser.add(new Tweet(tweetId, timestamp));
		timestamp++;
		// System.out.println(userId + "," + tweetId + "," + timestamp);

		user.tweets = tweetsByUser;
		users.put(userId, user);
	}
	
	public List<Integer> getNewsFeed(int userId) {
		PriorityQueue<Tweet> newsFeed = new PriorityQueue<>((a, b) -> (b.timestamp - a.timestamp));  // max-heap

		User user = users.get(userId);
		if (user == null) return new ArrayList<>();
		Set<Integer> usersForFeed = new HashSet<>();
		usersForFeed.addAll(user.followees);
		usersForFeed.add(userId);

		for (User u : users.values()) {
			if (usersForFeed.contains(u.id)) {
				List<Tweet> tweets = u.tweets;
				// add all tweets into max-heap (acc. to timestamp)
				for (Tweet t : tweets) {
					newsFeed.offer(t);
					// while (newsFeed.size() > NEWS_FEED_SIZE) {
					// 	newsFeed.poll();
					// }
				}
			}
		}
		// extract top 10 tweets
		List<Integer> retv = new ArrayList<>();
		int count = NEWS_FEED_SIZE;
		while(!newsFeed.isEmpty() && count-- > 0) {
			retv.add(newsFeed.poll().id);
		}
		return retv;
	}
	
	public void follow(int followerId, int followeeId) {
		if (followerId == followeeId) return;

		User user = users.getOrDefault(followerId, new User(followerId));

		Set<Integer> followees = user.followees;
		if (followees == null)
			followees = new HashSet<>();
		followees.add(followeeId);

		user.followees = followees;
		users.put(followerId, user);
	}
	
	public void unfollow(int followerId, int followeeId) {
		if (followerId == followeeId) return;

		User user = users.get(followerId);
		if (user == null) return;

		Set<Integer> followees = user.followees;
		if (followees != null) {
			followees.remove(followeeId);

			user.followees = followees;
			users.put(followerId, user);
		}
	}
}

